contracts/MusicStore.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MusicStore {
    struct Album {
        string uid;
        string title;
        uint price;
        uint quantity;
    }

    struct Order {
        string albumUid;
        address customer;
        uint orderAt;
        OrderStatus status;
    }

    enum OrderStatus { Paid, Delivered }

    Album[] public albums;
    Order[] public orders;

    address public owner;

    modifier onlyOwner() {
        require(owner == msg.sender, "Not an owner!");
        _;
    }

    constructor() {
        owner == msg.sender;
    }

    function addAlbum(
        string calldata uid, 
        string calldata title, 
        uint price, uint quantity
        ) external onlyOwner {
            albums.push(Album({
                uid: uid,
                title: title,
                price: price,
                quantity: quantity
            }));
    }
}

